import React from "react";
import {Nav,Container,Button} from "react-bootstrap"
const SideNav = () =>{
  return (
     <div className="sidebar">
    <a href="#news">Quản lý tài khoản giảng viên</a>
    <a href="#news">Quản lý tài khoản sinh viên</a>
    <a href="#contact">Quản lý thời gian biểu</a>
    <a href="#about">Quản lý lớp học</a>
    <a href="#news">Quản lý khóa học</a>
    <a href="#contact">Quản lý môn học</a>
    <a href="#about">Quản lý kỳ thi</a>
    <a href="#news">News</a>

</div>
    )
}
export default SideNav;
